function parseChapter(item) {
	if (item.isVip && item.isPay) {
		item.title = getUserchap1(item.userchap1) + item.title
	}
	list.push({
		title: item.title,
		url: item.url,
		isVolume: item.isVolume,
		isVip: item.isVip,
		isPay: item.isPay,
		userchap: item.userchap,
		userchap1: item.userchap1
	});
}
result.toArray().forEach((item, index) => {
	if (item.hasClass("MuiAccordionSummary-root")) {
		let summaryTitle = item.select("h4").text();
		parseChapter({
			title: summaryTitle,
			url: "",
			isVolume: true,
			isVip: false,
			isPay: false,
			userchap: "",
			userchap1: ""
		})
	} else {
		let title = item.select(".MuiListItemText-secondary").text();
		let url = item.attr("href");
		let userchap = item.select("svg:first-of-type").attr("data-testid");
		let userchap1 = item.select("svg:last-of-type").attr("data-testid");
		parseChapter({
			title: title,
			url: url,
			isVolume: false,
			isVip: payStatusMap[userchap] == "isClosed",
			isPay: payStatusMap[userchap1] == "isPay",
			userchap: userchap,
			userchap1: userchap1
		})
	}
})
JSON.stringify(list)
